'   v_patient_blood_group VARCHAR2(10) := :P22_BLOOD_GROUP; -- Page item for blood group',
'   pi_constant NUMBER := 3.14159265358979; -- Pi constant for manual conversion',
'BEGIN',
'   -- Fetch the nearest donors based on the patient''s details',
'   FOR r IN (',
'      SELECT  NAME, ',
'             LATITUDE, ',
'             LONGITUDE, ',
'             (6371 * ACOS(SIN(v_patient_lat * pi_constant / 180) ',
'                       * SIN(LATITUDE * pi_constant / 180) ',
'                       + COS(v_patient_lat * pi_constant / 180) ',
'                       * COS(LATITUDE * pi_constant / 180) ',
'                       * COS((LONGITUDE - v_patient_long) * pi_constant / 180))) AS DISTANCE',
'      FROM DONOR_INFO',
'      WHERE BLOOD_GROUP = v_patient_blood_group',
'      ORDER BY DISTANCE',
'      FETCH FIRST 1 ROWS ONLY',
'   ) LOOP',
'      -- Process the results (Example: Insert into a collection or session state for report)',
'      DBMS_OUTPUT.PUT_LINE(''Donor: '' || r.NAME || '' Distance: '' || r.DISTANCE);',
'   END LOOP;',
'END;',
''))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_internal_uid=>1340582897172332723
);
end;
