'	  REFERENCES "DONATION_CENTERS_HOSPITAL" ("CENTER_ID") ENABLE;',
'  ALTER TABLE "PATIENT_INFO" ADD CONSTRAINT "PATIENT_INFO_USERS_INFO_FK" FOREIGN KEY ("USERS_INFO_USER_ID")',
